import React from "react";
import { Link } from "react-router-dom";

type Props = {};

const DUMMY = [
  {
    id: "12",
    id_user: "231",
    title: "Title",
    content: "Some content",
    created: "day",
  },
];

const Questions = (props: Props) => {
  return (
    <div>
      <h1>Questions Page</h1>
      <ul>
        {DUMMY.map((question) => (
          <li key={question.id}>
            <Link to={`${question.id}`}></Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Questions;
